import React, { useState, useEffect } from "react";

const Paginator = ({ postsPerPage, totalPosts }) => {
  const pageNumbers = [];
  for (let i = 1; i <= Math.ceil(totalPosts / postsPerPage); i++) {
    pageNumbers.push(i);
  }
  return <div className="container"></div>;
};
export default Paginator;
